CREATE TABLE countries (
    countryid     VARCHAR2(4 CHAR) NOT NULL,
    country_name  VARCHAR2(150 CHAR),
    country_code  VARCHAR2(3 CHAR) NOT NULL,
    region        VARCHAR2(150 CHAR),
    income_group  VARCHAR2(50 CHAR)
);

ALTER TABLE countries ADD CONSTRAINT countries_pk PRIMARY KEY ( countryid );

CREATE TABLE indicator (
    countries_countryid  VARCHAR2(4 CHAR) NOT NULL,
    indicator_code       VARCHAR2(20 CHAR) NOT NULL,
    indicator_name       VARCHAR2(20 CHAR),
    source_note          VARCHAR2(255 CHAR),
    source_organization  VARCHAR2(500 CHAR)
);

ALTER TABLE indicator ADD CONSTRAINT indicator_pk PRIMARY KEY ( countries_countryid );

ALTER TABLE indicator
    ADD CONSTRAINT indicator_countries_fk FOREIGN KEY ( countries_countryid )
        REFERENCES countries ( countryid )
;
        

CREATE TABLE Poblation (
    P_REF           NUMBER(6),
    Country_Code    VARCHAR2(4 CHAR) NOT NULL,
    year            NUMBER(4),
    Poblation       NUMBER(15)
);


ALTER TABLE poblation ADD CONSTRAINT poblation_pk PRIMARY KEY ( year );


