-- 1. Mostrar valores por uno o mas año, por uno a más países.

SELECT YEAR, COUNTRY_NAME, POBLATION

FROM POBLATION

JOIN COUNTRIES ON COUNTRIES.COUNTRYCODE = POBLATION.COUNTRY_CODE

GROUP BY YEAR, COUNTRY_NAME, POBLATION

HAVING (YEAR > 1973 AND YEAR < 1979)  AND (COUNTRY_NAME = 'Aruba') or (COUNTRY_NAME = 'Benin')

ORDER BY COUNTRY_NAME
;

-- 2. Mostrar población total por uno o mas años, por uno o más países.


SELECT YEAR, COUNTRY_NAME, SUM(POBLATION)

FROM POBLATION

JOIN COUNTRIES ON COUNTRIES.COUNTRYCODE = POBLATION.COUNTRY_CODE

GROUP BY YEAR, COUNTRY_NAME, POBLATION

HAVING (YEAR > 1973 AND YEAR < 1979)  AND (COUNTRY_NAME = 'Aruba') or (COUNTRY_NAME = 'Benin')

ORDER BY COUNTRY_NAME

